define(['./is'], function (is) {

    /**
     * Check if both values are not identical/egal
     */
    /**
     * Description
     * @method isnt
     * @param {} x
     * @param {} y
     * @return UnaryExpression
     */
    function isnt(x, y){
        return !is(x, y);
    }

    return isnt;

});
